INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118061, 91002, 2, "ペコリーヌとの出会い", 10118, 2834, 8, "青空の下で謁見", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 7, 1, 0, "フリーマーケット会場", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118062, 91002, 2, "マホとの出会い", 10118, 2835, 8, "未来の騎空団\nマスコット？", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 7, 1, 0, "フリーマーケット会場", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118063, 91002, 2, "アキノとの出会い", 10118, 2837, 8, "お嬢さまからの\n緊急依頼", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 7, 1, 0, "ランドソル市街地", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118064, 91002, 2, "ジュンとの出会い", 10118, 4108402, 8, "黄金色の悩みごと", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 18, 1, 0, "フリーマーケット会場", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118065, 91002, 2, "カオリとの出会い", 10118, 4107402, 8, "白熱！　格闘大会！", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 18, 1, 0, "フリーマーケット会場", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118066, 91002, 2, "ニノンとの出会い", 10118, 9000227, 8, "祭り太鼓はオーエドの華", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 16, 1, 0, "オーエド町", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118067, 91002, 3, "スズナとの出会い", 10118, 2101181, 8, "人気者は遅れて\nやってくる", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 19, 1, 0, "フリーマーケット会場", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118068, 91002, 3, "ナナカとの出会い", 10118, 4109402, 8, "巫女・ミーツ・魔法少女", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 18, 1, 0, "ランドソル市街地", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118069, 91002, 3, "キャル＆コッコロとの出会い", 10118, 4305402, 8, "ネズ耳は二度なくなる", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 18, 1, 0, "フリーマーケット会場", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118070, 91002, 3, "ユカリとの出会い", 10118, 4101402, 8, "この出会いにカンパイ！", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 18, 1, 0, "ランドソル市街地", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118071, 91002, 3, "アオイとの出会い", 10118, 4106402, 8, "陰陽アンサンブル", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 18, 1, 0, "ランドソル市街地", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118072, 91002, 3, "シノブとの出会い", 10118, 2836, 8, "運試し十番勝負！", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 7, 1, 0, "フリーマーケット会場", 40);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (5118600, 0, 1, "オープニング", 10118, 0, 0, "彼女たちの新たな日常", 0, 0, 0, 0, 10145115, 0, 0);
